import React from "react";
import "./chatMessagesSkeleton.css";

const ChatMessagesSkeleton = () => {
  const skeletonMessages = [
    {
      own: false,
      padding: "20px 0",
    },
    {
      own: true,
      padding: "40px 0",
    },
    {
      own: false,
      padding: "20px 0",
    },
    {
      own: false,
      padding: "40px 0",
    },
    {
      own: true,
      padding: "60px 0",
    },
    {
      own: false,
      padding: "20px 0",
    },
  ];
  return (
    <>
      {skeletonMessages.map((item, i) => (
        <div key={i} className="chat-message-wrapper-skeleton">
          {!item.own && <div className="chat-message-PP-skeleton" />}
          <div
            style={{ padding: item.padding }}
            className={
              item.own ? "chat-message-skeleton own" : "chat-message-skeleton"
            }
          ></div>
        </div>
      ))}
    </>
  );
};

export default ChatMessagesSkeleton;
